import React from 'react'
import "../Publish.css";
import Navbar from '../../Header/Navbar';
import ppimg from '../../../landingAssets/pastaimage.jpg';

function Recipe() {
  return (
    <div>
    
   
        
        <div className='recipe-card-holder'>
            <p align="center">Pasta</p>
            <br/>
            <img src={ppimg} alt=""/>
            
            
        </div>  
        

    
    </div>
  )
}

export default Recipe
